import re
from uuid import uuid4
from datetime import datetime
from functools import lru_cache
from typing import Dict, List, Optional

class FileProcessor:
    _processed_files = set()  # Tracks processed files to avoid duplicates

    @classmethod
    def process_file(cls, file_id: str, content: str) -> str:
        if file_id in cls._processed_files:
            raise ValueError(f"File with ID {file_id} has already been processed.")
        cls._processed_files.add(file_id)
        return f"Processed file {file_id} with content length {len(content)}"

class AgencyCache:
    _cache: Dict[str, dict] = {}  # Maps request IDs to cached files

    @classmethod
    def cache_file(cls, data: dict) -> str:
        request_id = str(uuid4())
        cls._cache[request_id] = data
        return request_id

    @classmethod
    def get_cached_file(cls, request_id: str) -> Optional[dict]:
        return cls._cache.get(request_id)

class SubmissionManager:
    _submissions: Dict[str, dict] = {}  # Tracks submission statuses

    @classmethod
    def update_publish_status(cls, submission_id: str, status: str) -> None:
        if submission_id not in cls._submissions:
            cls._submissions[submission_id] = {}
        cls._submissions[submission_id]["publish_status"] = status

    @classmethod
    def get_publish_status(cls, submission_id: str) -> Optional[str]:
        submission = cls._submissions.get(submission_id)
        return submission.get("publish_status") if submission else None

