class SAMValidator:
    @staticmethod
    def check_completeness(sam_data: dict) -> bool:
        required_fields = ["entity_id", "tax_id", "address"]
        return all(field in sam_data and sam_data[field] for field in required_fields)

class ZipCodeValidator:
    @staticmethod
    def validate(zip_code: str) -> bool:
        # Validates 5-digit ZIP codes (last 4 digits optional)
        return bool(re.fullmatch(r"^\d{5}(?:-\d{4})?$", zip_code))

class UserTestingCoordinator:
    _scheduled_sessions: Dict[str, dict] = {}

    @classmethod
    def schedule_session(cls, agency: str, date: datetime) -> str:
        session_id = str(uuid4())
        cls._scheduled_sessions[session_id] = {"agency": agency, "date": date}
        return session_id

    @classmethod
    def generate_summary(cls, session_id: str) -> Optional[dict]:
        session = cls._scheduled_sessions.get(session_id)
        if not session:
            return None
        return {
            "summary": f"Testing session for {session['agency']} on {session['date']}",
            "feedback": ["Sample feedback entry 1", "Sample feedback entry 2"]
        }

